import React from 'react';
import { Data } from './Components/Data';  // Importing the array of cart data

function App() {
    return (
        <div className='bg-gray-400'>
            <h1 className='text-center text-black text-[50px]'>CARTS</h1>
            <div className="flex justify-center flex-wrap">
                {Data.map((item, index) => (
                    <div key={index} className='w-[250px] h-auto flex flex-col justify-center items-center m-4 p-4 bg-white shadow-md rounded-md'>
                        <span className='text-xl font-semibold'>Price: {item.price}</span>
                        <span className='text-lg'>Name: {item.name}</span>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default App;
